import React from 'react';
import { Statistic, Row, Col } from 'antd';
import 'antd/dist/antd.css';

const statistics = {
    "overallScore": 112893,
    "accountBalance": 112893
}

class StNum extends React.Component {
    render() {
        return (
            <div>
                <Row gutter={16}>
                    <Col span={12}>
                        <Statistic title="Active Users" value={this.statistics.overallScore} />
                    </Col>
                    <Col span={12}>
                        <Statistic title="Account Balance (CNY)" value={this.props.statistics.accountBalance} precision={2} />
                    </Col>
                </Row>
            </div>
        );
    }
}

export default StNum;
